import React, {useEffect, useState} from "react";
import {paginate} from "../../../Services/paginationUtils";
import {deleteUser, getAllUsers} from "../../../Repositories/UserRepository";

export default function AdminUsers() {
    const [users, setUsers] = useState([]);
    const [currentPage, setCurrentPage] = useState(1);
    const usersPerPage = 7;

    useEffect(() => {
        async function fetchData() {
            try {
                const data = await getAllUsers();
                setUsers(data);
            } catch (error) {
                console.error(error);
            }
        }

        fetchData();
    }, []);

    const currentUsers = paginate(users, currentPage, usersPerPage);
    const handlePageChange = (pageNumber) => setCurrentPage(pageNumber);


    const handleDelete = async ($id) => {
        try {
            const data =  await deleteUser($id);
            setUsers(data)
        } catch (error) {
            console.error(error);
        }

    }

    return (
        <div className="px-4 sm:px-6 lg:px-8 mt-12">
            <div className="sm:flex sm:items-center">
                <div className="sm:flex-auto">
                    <h1 className="font-bold text-xl leading-6 text-gray-900">Uživatelé</h1>
                    <p className="mt-2 text-sm text-gray-700">
                    </p>
                </div>
                <div className="mt-4 sm:ml-16 sm:mt-0 sm:flex-none">
                    <a
                        href="/admin/pridatUzivatele"
                        className="block rounded-md bg-indigo-600 px-3 py-2 text-center text-sm font-semibold text-white shadow-sm hover:bg-indigo-500 focus-visible:outline focus-visible:outline-2 focus-visible:outline-offset-2 focus-visible:outline-indigo-600"
                    >
                        Přidat uživatele
                    </a>
                </div>
            </div>
            <div className="mt-8 flow-root">
                <div className="-mx-4 -my-2 overflow-x-auto sm:-mx-6 lg:-mx-8">
                    <div className="inline-block min-w-full py-2 align-middle sm:px-6 lg:px-8">
                        <table className="min-w-full divide-y divide-gray-300">
                            <thead>
                            <tr>
                                <th scope="col" className="px-3 py-3.5 text-left text-sm font-semibold text-gray-900">
                                    Email
                                </th>
                                <th scope="col" className="py-3.5 pl-4 pr-3 text-left text-sm font-semibold text-gray-900 sm:pl-0">
                                    Práva
                                </th>
                                <th scope="col" className="relative py-3.5 pl-3 pr-4 sm:pr-0">
                                    <span className="sr-only">Edit</span>
                                </th>
                            </tr>
                            </thead>
                            <tbody className="divide-y divide-gray-200">
                            {currentUsers.map((user) => (
                                <tr key={user.id} className={"text-left h-20"}>
                                    <td className="whitespace-nowrap px-3 py-4 text-sm text-gray-500">{user.email}</td>
                                    <td className="whitespace-nowrap px-3 py-4 text-sm text-gray-500">{user.getNameOfAccess()}</td>

                                    <td className="relative whitespace-nowrap py-4 pl-3 pr-4 text-right text-sm font-medium sm:pr-0">
                                        <a href={"/admin/editUzivatel/" + user.id} className="text-indigo-600 hover:text-indigo-900 mr-5 cursor-pointer">
                                            Upravit<span className="sr-only">, {user.id}</span>
                                        </a>
                                        <a onClick={() => handleDelete(user.id)} className="text-indigo-600 hover:text-indigo-900 mr-5 cursor-pointer">
                                            Odstranit<span className="sr-only">, {user.id}</span>
                                        </a>
                                    </td>
                                </tr>
                            ))}
                            </tbody>
                        </table>
                    </div>
                </div>
            </div>
            <div className="mt-7">
                {users.length > usersPerPage && (
                    <nav className="bg-white px-4 py-3 flex items-center justify-between border-t border-gray-200 sm:px-6">
                        <div className="hidden sm:block">
                            <p className="text-sm text-gray-700">
                                {((currentPage - 1) * usersPerPage) + 1} - {Math.min((currentPage * usersPerPage), users.length)} z {users.length} uživatelů
                            </p>
                        </div>
                        <div className="flex-1 flex justify-between sm:justify-end">
                            <button
                                onClick={() => handlePageChange(currentPage - 1)}
                                disabled={currentPage === 1}
                                className="relative inline-flex items-center px-4 py-2 border border-gray-300 bg-white text-sm font-medium text-gray-700 hover:bg-gray-50"
                            >
                                Předešlé
                            </button>
                            <button
                                onClick={() => handlePageChange(currentPage + 1)}
                                disabled={currentUsers.length < usersPerPage}
                                className="ml-3 relative inline-flex items-center px-4 py-2 border border-gray-300 bg-white text-sm font-medium text-gray-700 hover:bg-gray-50"
                            >
                                Další
                            </button>
                        </div>
                    </nav>
                )}
            </div>
        </div>
    )
}
